Mongodb aggregate to return result only if the lookup field has length<p>I have two collections <code>users</code> and <code>profiles</code>. I am implementing a search with the following query:</p>
<pre><code>User.aggregate(
      [
        { 
          $match: { 
          _id: { $ne: req.user.id },
          isDogSitter: { $eq: true },
          profileId: { $exists: true }
        }},
        {
          $project: {
            firstName: 1,
            lastName: 1,
            email: 1,
            isDogSitter: 1,
            profileId: 1,
        }},
        {
          $lookup: {
            from: &quot;profiles&quot;,
            pipeline: [
              {
                $project: {
                  __v: 0,
                  availableDays: 0,
              }},
              {
                $match: {
                  city: search
              }}
            ],
            as: &quot;profileId&quot;,
        }}
      ],
      (error, result) =&gt; {
        console.log(&quot;RESULT &quot;, result);
      }
    );
</code></pre>
<p>What this does is that its searches for the <code>city</code> in the <code>profiles</code> collection and when there is not search match then <code>profileId</code> becomes an empty array. What I really want is that if the <code>profileId</code> is an empty array then I don't want to return the other fields in the documents too. It should empty the array. Below is my current returned result.</p>
